app.controller("contactListController",function(n,e,t,o){t.getData().then(function(e){n.userContacts=e},function(e){n.userContacts=e}),n.previousPage=function(){e.go("newEvent")},n.addedUsers=[],n.addContacts=function(){angular.forEach(n.userContacts,function(e,t){e.checked&&n.addedUsers.push(e.name)}),o.setAddedUsers(n.addedUsers),e.go("newEvent")}});